import Header from "./Header";

function About() {
  return (
    <>
      <div className="main">
        <Header />
        <div className="body">
          <div className="about-content">
            <div className="about-title">
              <h1>Apie</h1>
              <p>
                Svetainės tikslas yra realizuoti studentinio dalyko,
                Virtualizacijos pagrindų projektą.
              </p>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default About;
